import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt } from 'react-icons/fa';

const FeatureCard = ({ title, description, icon: Icon }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-50 p-6 rounded-lg backdrop-filter backdrop-blur-sm"
    whileHover={{ y: -5 }}
    transition={{ duration: 0.3 }}
  >
    <Icon className="w-8 h-8 text-indigo-400 mb-4" />
    <h3 className="text-xl font-semibold text-white mb-2">{title}</h3>
    <p className="text-gray-300 text-sm">{description}</p>
  </motion.div>
);

const Info2 = () => {
  const features = [
    { title: "AI-Powered Development", description: "Harness the power of AI to accelerate your development process.", icon: FaRocket },
    { title: "Scalable Infrastructure", description: "Build on a foundation that grows with your business needs.", icon: FaCloud },
    { title: "Enhanced Security", description: "Protect your assets with state-of-the-art security measures.", icon: FaShieldAlt },
    { title: "Flexible Architecture", description: "Adapt quickly to changing market demands with our flexible systems.", icon: FaExpandArrowsAlt },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-black text-white py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold mb-4">
            Elevate Your Development Experience
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            Discover how TokTok's innovative solutions can transform your software development process.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8 mb-16">
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="text-center"
        >
          <h3 className="text-2xl font-semibold mb-6">Ready to revolutionize your development process?</h3>
          <motion.button 
            className="bg-indigo-600 text-white px-8 py-3 rounded-md font-medium text-lg hover:bg-indigo-700 transition-colors"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Start Your Journey
          </motion.button>
        </motion.div>
      </div>
    </div>
  );
};

export default Info2;
